import React from 'react';
import {Row, Col} from 'react-bootstrap';

export default class MovieDetail extends React.Component {

    render() {
        return (
             <div className="container">
                <Row>
                    <Col>
                        <Row>
                            <img src="./logo.png" alt="Movie Poster"/>
                        </Row>
                    </Col>
                    <Col>

                    </Col>
                </Row>
             </div>
        );
    }
}
